import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import LoginScreen from './screens/LoginScreen';
import Dashboard from './screens/Dashboard';
import { withOneTabEnforcer } from 'react-one-tab-enforcer';

// import WindowFocusHandler from './screens/WindowFocusHandler';

function App() {
  return (
    <Router>
      <Route path="/" component={LoginScreen} exact />
      <Route path="/dashboard" component={Dashboard} exact />
      {/* <WindowFocusHandler /> */}
    </Router>
  );
}

const DifferentWarningComponent = () => <div>NO WAY!</div>;
export default withOneTabEnforcer({
  appName: 'my-unique-app-name',
  OnlyOneTabComponent: DifferentWarningComponent,
})(App);
